import React from "react";
import Header from "../Header/Header";
import Footer from "../Footer/Foot";
import Products from "../Products.jsx/Products";
import ProductData from "../Data/ProductData";

function Cars() {
  const item = ProductData.map((item))
  return (
    <React.Fragment>
      <Header />
      <div className="container-fluid d-flex justify-content-center">
        <div className="row mt-4 p-3">

          <Products
            img={ProductData[0].img}
            price={ProductData[0].price}
            engine={ProductData[0].engine}
            fuel={ProductData[0].fuel}
            hspwr={ProductData[0].horsepower}
            mileage={ProductData[0].mileage}
          />
          <Footer />
        </div>
      </div>
    </React.Fragment>
  );
}
export default Cars;
